import { useState } from 'react';
import './Cryptic.style.css';
const Cryptic = () => {


  const [passList, setPassList] = useState('');

  useEffect(() => {
    fetch('http://localhost:3001/pass-list', {
      method: 'GET',
      headers: {
        'Content-Type': 'application/json',
        token: 'Bearer' + sessionStorage.getItem('token'),
      },
    })
      .then((response) => response.json())
      .then((data) => {
        // console.log(data);
        setPassList(data);
      })
      .catch((error) => console.log(error));
  }, []);


  const selectorComp = () => {
    passList.map((option) => (
      <option key={option._id} value={option.passwordOrg}>
        {option.passwordOrg}
      </option>
    ));
  };

  return (
    <>
      <div>
        {passList.length > 1 ? (
          <select name='' id=''>
            {selectorComp}
          </select>
        ) : null}
      </div>
      <div className='w-full cryptic-container'>
        <div>
          <input type='text' name='' id='' className='message' />
        </div>
        <div>
          <button>Encrypt</button>
          <button>Decrypt</button>
        </div>
        <div>
          <input type='text' className='message message-output' />
        </div>
      </div>
    </>
  );
};

export default Cryptic;
